class UserResponse {      int? _id;      String? _createdAt;      String? _updatedAt;      int? _createdBy;      int? _updatedBy;      String? _name;      String? _lastName;      String? _userName;      String? _password;      String? _email;      String? _phoneNumber;      int? _quarterId;      String? _entityStatus;      List<Roles>? _roles;      String? _username;      List<Authorities>? _authorities;       bool? _deleted;  UserResponse(      {int? id,        String? createdAt,        String? updatedAt,        int? createdBy,        int? updatedBy,        String? name,        String? lastName,        String? userName,        String? password,        String? email,        String? phoneNumber,        int? quarterId,        String? entityStatus,        List<Roles>? roles,        String? username,        List<Authorities>? authorities,        bool? deleted}) {    if (id != null) {      this._id = id;    }    if (createdAt != null) {      this._createdAt = createdAt;    }    if (updatedAt != null) {      this._updatedAt = updatedAt;    }    if (createdBy != null) {      this._createdBy = createdBy;    }    if (updatedBy != null) {      this._updatedBy = updatedBy;    }    if (name != null) {      this._name = name;    }    if (lastName != null) {      this._lastName = lastName;    }    if (userName != null) {      this._userName = userName;    }    if (password != null) {      this._password = password;    }    if (email != null) {      this._email = email;    }    if (phoneNumber != null) {      this._phoneNumber = phoneNumber;    }    if (quarterId != null) {      this._quarterId = quarterId;    }    if (entityStatus != null) {      this._entityStatus = entityStatus;    }    if (roles != null) {      this._roles = roles;    }    if (username != null) {      this._username = username;    }    if (authorities != null) {      this._authorities = authorities;    }    if (deleted != null) {      this._deleted = deleted;    }  }  int? get id => _id;  set id(int? id) => _id = id;  String? get createdAt => _createdAt;  set createdAt(String? createdAt) => _createdAt = createdAt;  String? get updatedAt => _updatedAt;  set updatedAt(String? updatedAt) => _updatedAt = updatedAt;  int? get createdBy => _createdBy;  set createdBy(int? createdBy) => _createdBy = createdBy;  int? get updatedBy => _updatedBy;  set updatedBy(int? updatedBy) => _updatedBy = updatedBy;  String? get name => _name;  set name(String? name) => _name = name;  String? get lastName => _lastName;  set lastName(String? lastName) => _lastName = lastName;  String? get userName => _userName;  set userName(String? userName) => _userName = userName;  String? get password => _password;  set password(String? password) => _password = password;  String? get email => _email;  set email(String? email) => _email = email;  String? get phoneNumber => _phoneNumber;  set phoneNumber(String? phoneNumber) => _phoneNumber = phoneNumber;  int? get quarterId => _quarterId;  set quarterId(int? quarterId) => _quarterId = quarterId;  String? get entityStatus => _entityStatus;  set entityStatus(String? entityStatus) => _entityStatus = entityStatus;  List<Roles>? get roles => _roles;  set roles(List<Roles>? roles) => _roles = roles;  String? get username => _username;  set username(String? username) => _username = username;  List<Authorities>? get authorities => _authorities;  set authorities(List<Authorities>? authorities) => _authorities = authorities;  bool? get deleted => _deleted;  set deleted(bool? deleted) => _deleted = deleted;  UserResponse.fromJson(Map<String, dynamic> json) {    _id = json['id'];    _createdAt = json['createdAt'];    _updatedAt = json['updatedAt'];    _createdBy = json['createdBy'];    _updatedBy = json['updatedBy'];    _name = json['name'];    _lastName = json['lastName'];    _userName = json['userName'];    _password = json['password'];    _email = json['email'];    _phoneNumber = json['phoneNumber'];    _quarterId = json['quarter_id'];    _entityStatus = json['entityStatus'];    if (json['roles'] != null) {      _roles = <Roles>[];      json['roles'].forEach((v) {        _roles!.add(new Roles.fromJson(v));      });    }    _username = json['username'];    if (json['authorities'] != null) {      _authorities = <Authorities>[];      json['authorities'].forEach((v) {        _authorities!.add(new Authorities.fromJson(v));      });    }    _deleted = json['deleted'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this._id;    data['createdAt'] = this._createdAt;    data['updatedAt'] = this._updatedAt;    data['createdBy'] = this._createdBy;    data['updatedBy'] = this._updatedBy;    data['name'] = this._name;    data['lastName'] = this._lastName;    data['userName'] = this._userName;    data['password'] = this._password;    data['email'] = this._email;    data['phoneNumber'] = this._phoneNumber;    data['quarter_id'] = this._quarterId;    data['entityStatus'] = this._entityStatus;    if (this._roles != null) {      data['roles'] = this._roles!.map((v) => v.toJson()).toList();    }    data['username'] = this._username;    if (this._authorities != null) {      data['authorities'] = this._authorities!.map((v) => v.toJson()).toList();    }    data['deleted'] = this._deleted;    return data;  }}class Roles {  int? _id;  String? _description;  String? _roleName;  String? _roleLevel;  List<Permissions>? _permissions;  Roles(      {int? id,        String? description,        String? roleName,        String? roleLevel,        List<Permissions>? permissions}) {    if (id != null) {      this._id = id;    }    if (description != null) {      this._description = description;    }    if (roleName != null) {      this._roleName = roleName;    }    if (roleLevel != null) {      this._roleLevel = roleLevel;    }    if (permissions != null) {      this._permissions = permissions;    }  }  int? get id => _id;  set id(int? id) => _id = id;  String? get description => _description;  set description(String? description) => _description = description;  String? get roleName => _roleName;  set roleName(String? roleName) => _roleName = roleName;  String? get roleLevel => _roleLevel;  set roleLevel(String? roleLevel) => _roleLevel = roleLevel;  List<Permissions>? get permissions => _permissions;  set permissions(List<Permissions>? permissions) => _permissions = permissions;  Roles.fromJson(Map<String, dynamic> json) {    _id = json['id'];    _description = json['description'];    _roleName = json['roleName'];    _roleLevel = json['roleLevel'];    if (json['permissions'] != null) {      _permissions = <Permissions>[];      json['permissions'].forEach((v) {        _permissions!.add(new Permissions.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this._id;    data['description'] = this._description;    data['roleName'] = this._roleName;    data['roleLevel'] = this._roleLevel;    if (this._permissions != null) {      data['permissions'] = this._permissions!.map((v) => v.toJson()).toList();    }    return data;  }}class Permissions {  int? _id;  String? _description;  String? _permissionName;  Permissions({int? id, String? description, String? permissionName}) {    if (id != null) {      this._id = id;    }    if (description != null) {      this._description = description;    }    if (permissionName != null) {      this._permissionName = permissionName;    }  }  int? get id => _id;  set id(int? id) => _id = id;  String? get description => _description;  set description(String? description) => _description = description;  String? get permissionName => _permissionName;  set permissionName(String? permissionName) =>      _permissionName = permissionName;  Permissions.fromJson(Map<String, dynamic> json) {    _id = json['id'];    _description = json['description'];    _permissionName = json['permissionName'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this._id;    data['description'] = this._description;    data['permissionName'] = this._permissionName;    return data;  }}class Authorities {  String? _authority;  Authorities({String? authority}) {    if (authority != null) {      this._authority = authority;    }  }  String? get authority => _authority;  set authority(String? authority) => _authority = authority;  Authorities.fromJson(Map<String, dynamic> json) {    _authority = json['authority'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['authority'] = this._authority;    return data;  }}